import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import AdminDashboard from './pages/admin/AdminDashboard';
import MemberDashboard from './pages/member/MemberDashboard';
import ComplaintsPage from './pages/admin/ComplaintsPage';
import ExpensesPage from './pages/admin/ExpensesPage';
import NotificationsPage from './pages/admin/NotificationsPage';
import MemberComplaintsPage from './pages/member/ComplaintsPage';
import MemberExpensesPage from './pages/member/ExpensesPage';
import MemberNotificationsPage from './pages/member/NotificationsPage';
import MainLayout from './components/layout/MainLayout';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login/:type" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/admin/dashboard" element={
              <MainLayout>
                <AdminDashboard />
              </MainLayout>
            } />
            <Route path="/admin/complaints" element={
              <MainLayout>
                <ComplaintsPage />
              </MainLayout>
            } />
            <Route path="/admin/expenses" element={
              <MainLayout>
                <ExpensesPage />
              </MainLayout>
            } />
            <Route path="/admin/notifications" element={
              <MainLayout>
                <NotificationsPage />
              </MainLayout>
            } />
            <Route path="/member/dashboard" element={
              <MainLayout>
                <MemberDashboard />
              </MainLayout>
            } />
            <Route path="/member/complaints" element={
              <MainLayout>
                <MemberComplaintsPage />
              </MainLayout>
            } />
            <Route path="/member/expenses" element={
              <MainLayout>
                <MemberExpensesPage />
              </MainLayout>
            } />
            <Route path="/member/notifications" element={
              <MainLayout>
                <MemberNotificationsPage />
              </MainLayout>
            } />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
